import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class BeatsContainer extends React.Component {
    render() {
        return (
            <div className="beats-main-container">
                <ul>
                    <li>1</li>
                    <li>2</li>
                    <li>3</li>
                    <li>4</li>
                    <li>5</li>
                    <li>6</li>
                    <li>7</li>
                    <li>8</li>
                </ul>
            </div>
        );
    }
}

class BeatContainer extends React.Component {
    render() {
        return (
            <div className="beats-main-container">
                <ul>
                    <li>1</li>
                    <li>2</li>
                    <li>3</li>
                    <li>4</li>
                    <li>5</li>
                    <li>6</li>
                    <li>7</li>
                    <li>8</li>
                </ul>
            </div>
        );
    }
}

ReactDOM.render(
    <ShoppingList/>,
    document.getElementById('root')
);
